import React, { useState } from 'react';
import styles from './Main.module.css';
import Button from '../../ui/button/Button';
import Input from '../../ui/input/Input';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faCompactDisc, faMusic, faClock, faHourglassEnd } from '@fortawesome/free-solid-svg-icons';

const Main = () => {
    const [formData, setFormData] = useState({
        artist: '',
        album: '',
        track: '',
        startTimestamp: '',
        endTimestamp: '',
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData(prevState => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(formData);
    };

       return (
        <section>
            <h2>Home</h2>
            <form onSubmit={handleSubmit} className={styles.form}>
                <table className={styles.inputTable}>
                    <tbody>
                        <tr>
                            <td><FontAwesomeIcon icon={faUser} /></td>
                            <td>Artist</td>
                            <td className={styles.inputWithButtonsContainer}>
                                <div className={styles.inputAndButtons}>
                                    <Input
                                        id="artist"
                                        type="text"
                                        name="artist"
                                        value={formData.artist}
                                        onChange={handleChange}
                                        placeholder="Enter artist name"
                                    />
                                    <div className={styles.optionList}>
                                        {/* Adjust Button components if needed to ensure they receive props correctly */}
                                        <Button>Top Artist 1</Button>
                                        <Button>Top Artist 2</Button>
                                        <Button>Top Artist 3</Button>
                                    </div>
                                </div>
                            </td>
                        </tr>
                        {/* Remaining rows unchanged */}
                    </tbody>
                </table>
            </form>
        </section>
    );

};

export default Main;
